    //初始化题目
    function initQuestions(_questions){
      var html="";
      q_index=0;
      q_len=Object.keys(_questions).length;
      var k=0;
      $.each(_questions,function(i,v){
        k++;
        var id=i;
        var type=v.type;
        var ques=v.ques;
        var itype=type=="单选题"?"radio":"checkbox";
        var html_anws="";
        var note=v.note;
        $.each(v.anws,function(i1,v1){
          var i_id=id+'_'+v1.ans;
          html_anws+='\
                <div class="div_ans">\
                  <input id="'+i_id+'" type="'+itype+'" name="'+id+'" value="'+v.anw+'"><label for="'+i_id+'">'+v1.ans+"、"+v1.ans_t+'</label>\
                </div>';
        });
        var tmphtml='<div class="q_cont" id="'+id+'">\
              <div class="div3_2_1"><span class="q_t1">'+type+'</span><span class="q_t2">'+k+'/'+q_len+'</span></div>\
              <div class="div3_2_2">'+k+"、"+ques+'</div>\
              <div class="div3_2_3">'+html_anws+'</div>\
              <div class="div3_2_4">'+note+'</div>\
            </div>';
        html+=tmphtml;
      });
      $("#q_list").html(html);
      $(".q_cont").eq(0).show();
    }


