    function randArray(m, len) {
        m.sort(function () {
            return Math.random() - 0.5;
        });
        return m.slice(0, len);
    }
    function sortDataRand(data) {
      let ordered = {};
      let compareFunction = function() {
        return Math.random() - 0.5;
      };
      Object.keys(data).sort(compareFunction).forEach(function(key) {
        //console.log(key);
        ordered[key] = data[key];
      });
      return ordered;
    }

